@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:DisplayError a owl:Class .
atm:ReturnCard a owl:Class .

atm:ATM a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
                      owl:onProperty atm:hasOperation ;
                      owl:someValuesFrom atm:DisplayError
                    ] ,
                    [ a owl:Restriction ;
                      owl:onProperty atm:hasOperation ;
                      owl:someValuesFrom atm:ReturnCard
                    ] .

atm:hasOperation a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range [ a owl:Class ;
                 owl:unionOf (atm:DisplayError atm:ReturnCard)
               ] .
